import Foundation

let input = """

"""

extension Character {
    func isMember(of set: CharacterSet) -> Bool {
        guard let scalar = UnicodeScalar(String(self)) else { return false }
        return set.contains(scalar)
    }
    var isLowercase: Bool {
        return isMember(of: .lowercaseLetters)
    }
    func flipCase() -> Character {
        if isLowercase {
            return Character( String( self ).uppercased() )
        }
        
        return Character( String( self ).lowercased() )
    }
}

func react( _ input: String ) -> String {
    var output = input
    var lastCount = Int.max
    
    while output.count < lastCount {
        var target: Character? = nil
        
        lastCount = output.count
        for ( index, char ) in output.enumerated() {
            guard let goal = target else {
                target = char.flipCase()
                continue
            }
            
            if char != goal {
                target = char.flipCase()
            } else {
                let removeIndex = output.index( output.startIndex, offsetBy: index - 1 )
                
                output.remove( at: removeIndex )
                output.remove( at: removeIndex )
                break
            }
        }
    }
    
    return output
}

func remove( input: String, type: Character ) -> String {
    let output = input.replacingOccurrences( of: String( type ), with: "" )
    let upper = String( type ).uppercased()
    
    return output.replacingOccurrences( of: upper, with: "" )
}

func part2( _ input: String ) -> Int {
    return "abcdefghijklmnopqrstuvwxyz".reduce( input.count ) {
        min( $0, react( remove(input: input, type: $1) ).count )
    }
}

print( "Part1:", react(input).count )
print( "part2:", part2(input) )
